import React, { useState, useEffect } from "react";
import { useParams } from 'react-router-dom';
import {contentMultipleCategoryContent} from './apiConfig'

const ContentPageMultiple = () => {
  const { param1, param2 } = useParams();
  const [categoryContent, setCategoryContent] = useState('');

  useEffect(() => {
    console.log("param1:", param1);
    console.log("param2:", param2);
    fetchCategoryContent(param1, param2);
  }, [param1, param2]);

  const fetchCategoryContent = (param1, letter) => {
    const baseUrl = 'http://localhost:1337/site/biblio'; // Adjust based on your actual backend URL
    const url = letter ? `${baseUrl}/${letter}` : baseUrl; // Include the letter in the URL if provided

    fetch(url)
      .then(response => response.json())
      .then(data => {
        setCategoryContent(data); // Update to use setCategoryContent
      })
      .catch(error => console.error('Error fetching content:', error));
};



  console.log("Render categoryContent:", categoryContent);

  return (
    <div className="generalPages">
      <p>{categoryContent.length > 0 && categoryContent[0].p_name_rus}</p>
    </div>
  );
};

export default ContentPageMultiple;
